deprecated_libraries.info:
  path: '/deprecated'
  defaults:
    _title: 'Deprecated Libraries Example Information'
    _controller: '\Drupal\deprecated_libraries\Controller\DeprecatedLibsController::description'
  requirements:
    _permission: 'access content'

